0439\u0442\u0438 \u0432 \u0441\u0438\u043b\u0443 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/4_%D0%BD%D0%BE%D1%8F%D0%B1%D1%80%D1%8F\" title=\"4 \u043d\u043e\u044f\u0431\u0440\u044f\">4 \u043d\u043e\u044f\u0431\u0440\u044f<\/a>).<\/li><li>\u0412\u043e\u0435\u043d\u043d\u044b\u0439 \u043f\u0430\u0442\u0440\u0443\u043b\u044c \u0440\u0430\u0441\u0441\u0442\u0440\u0435\u043b\u0438\u0432\u0430\u0435\u0442 \u043c\u0430\u0442\u0440\u043e\u0441\u043e\u0432 \u0438 \u0441\u043e\u043b\u0434\u0430\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B8%D0%BB%D1%8C_(%D0%B3%D0%BE%D1%80%D0%BE%D0%B4)\" title=\"\u041a\u0438\u043b\u044c (\u0433\u043e\u0440\u043e\u0434)\">\u043a\u0438\u043b\u044c\u0441\u043a\u043e\u0433\u043e<\/a> \u0433\u0430\u0440\u043d\u0438\u0437\u043e\u043d\u0430, \u0432\u043e \u0432\u0440\u0435\u043c\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B8%D0%BB%D1%8C%D1%81%D0%BA%D0%BE%D0%B5_%D0%B2%D0%BE%D1%81%D1%81%D1%82%D0%B0%D0%BD%D0%B8%D0%B5_1918_%D0%B3%D0%BE%D0%B4%D0%B0\" title=\"\u041a\u0438\u043b\u044c\u0441\u043a\u043e\u0435 \u0432\u043e\u0441\u0441\u0442\u0430\u043d\u0438\u0435 1918 \u0433\u043e\u0434\u0430\">\u0434\u0435\u043c\u043e\u043d\u0441\u0442\u0440\u0430\u0446\u0438\u0438 \u0438 \u043c\u0438\u0442\u0438\u043d\u0433\u0430 \u043f\u0440\u043e\u0442\u0435\u0441\u0442\u0430<\/a>.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1928_%D0%B3%D0%BE%D0%B4\" title=\"1928 \u0433\u043e\u0434\">1928<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D1%83%D1%80%D1%86%D0%B8%D1%8F\" title=\"\u0422\u0443\u0440\u0446\u0438\u044f\">\u0422\u0443\u0440\u0446\u0438\u044f<\/a> \u043f\u0435\u0440\u0435\u0445\u043e\u0434\u0438\u0442 \u0441 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D1%80%D0%B0%D0%B1%D1%81%D0%BA%D0%BE%D0%B5_%D0%BF%D0%B8%D1%81%D1%8C%D0%BC%D0%BE\" title=\"\u0410\u0440\u0430\u0431\u0441\u043a\u043e\u0435 \u043f\u0438\u0441\u044c\u043c\u043e\">\u0430\u0440\u0430\u0431\u0441\u043a\u043e\u0433\u043e<\/a> \u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B0%D1%82%D0%B8%D0%BD%D1%81%D0%BA%D0%B8%D0%B9_%D0%B0%D0%BB%D1%84%D0%B0%D0%B2%D0%B8%D1%82\" title=\"\u041b\u0430\u0442\u0438\u043d\u0441\u043a\u0438\u0439 \u0430\u043b\u0444\u0430\u0432\u0438\u0442\">\u043b\u0430\u0442\u0438\u043d\u0441\u043a\u0438\u0439 \u0430\u043b\u0444\u0430\u0432\u0438\u0442<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1934_%D0%B3%D0%BE%D0%B4\" title=\"1934 \u0433\u043e\u0434\">1934<\/a>&#160;\u2014 \u0432\u0435\u0440\u0445\u043e\u0432\u043d\u044b\u0439 \u0444\u0440\u0430\u043d\u0446\u0443\u0437\u0441\u043a\u0438\u0439 \u043a\u043e\u043c\u0438\u0441\u0441\u0430\u0440 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B8%D1%80%D0%B8%D1%8F\" title=\"\u0421\u0438\u0440\u0438\u044f\">\u0421\u0438\u0440\u0438\u0438<\/a> \u043e\u0431\u044a\u044f\u0432\u043b\u044f\u0435\u0442 \u043e \u0440\u043e\u0441\u043f\u0443\u0441\u043a\u0435 \u043c\u0435\u0441\u0442\u043d\u043e\u0433\u043e \u043f\u0430\u0440\u043b\u0430\u043c\u0435\u043d\u0442\u0430 \u043d\u0430 \u043d\u0435\u043e\u043f\u0440\u0435\u0434\u0435\u043b\u0451\u043d\u043d\u044b\u0439 \u0441\u0440\u043e\u043a.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1935_%D0%B3%D0%BE%D0%B4\" title=\"1935 \u0433\u043e\u0434\">1935<\/a><ul><li>\u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D1%80%D0%B5%D1%86%D0%B8%D1%8F\" title=\"\u0413\u0440\u0435\u0446\u0438\u044f\">\u0413\u0440\u0435\u0446\u0438\u0438<\/a> \u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B5%D1%84%D0%B5%D1%80%D0%B5%D0%BD%D0%B4%D1%83%D0%BC\" title=\"\u0420\u0435\u0444\u0435\u0440\u0435\u043d\u0434\u0443\u043c\">\u043f\u043b\u0435\u0431\u0438\u0441\u0446\u0438\u0442\u0435<\/a> \u043f\u043e \u0432\u043e\u043f\u0440\u043e\u0441\u0443 \u043e \u0432\u043e\u0441\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u0438\u0438 \u043c\u043e\u043d\u0430\u0440\u0445\u0438\u0438 \u0438 \u0438\u0437\u0431\u0440\u0430\u043d\u0438\u0438 \u043a\u043e\u0440\u043e\u043b\u0451\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B5%D0%BE%D1%80%D0%B3_II_(%D0%BA%D0%BE%D1%80%D0%BE%D0%BB%D1%8C_%D0%93%D1%80%D0%B5%D1%86%D0%B8%D0%B8)\" title=\"\u0413\u0435\u043e\u0440\u0433 II (\u043a\u043e\u0440\u043e\u043b\u044c \u0413\u0440\u0435\u0446\u0438\u0438)\">\u0413\u0435\u043e\u0440\u0433\u0430 II<\/a> \u043f\u043e\u043b\u043e\u0436\u0438\u0442\u0435\u043b\u044c\u043d\u043e \u0432\u044b\u0441\u043a\u0430\u0437\u044b\u0432\u0430\u044e\u0442\u0441\u044f 97&#160;% \u043f\u0440\u043e\u0433\u043e\u043b\u043e\u0441\u043e\u0432\u0430\u0432\u0448\u0438\u0445 \u0433\u0440\u0430\u0436\u0434\u0430\u043d.<\/li><li>\u0424\u0440\u0430\u043d\u0446\u0443\u0437\u0441\u043a\u0438\u0435 \u0441\u043e\u0446\u0438\u0430\u043b\u0438\u0441\u0442\u0438\u0447\u0435\u0441\u043a\u0438\u0435 \u043e\u0440\u0433\u0430\u043d\u0438\u0437\u0430\u0446\u0438\u0438 \u043e\u0431\u044a\u0435\u0434\u0438\u043d\u044f\u044e\u0442\u0441\u044f \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BE%D1%8E%D0%B7_%D1%81%D0%BE%D1%86%D0%B8%D0%B0%D0%BB%D0%B8%D1%81%D1%82%D0%BE%D0%B2\" title=\"\u0421\u043e\u044e\u0437 \u0441\u043e\u0446\u0438\u0430\u043b\u0438\u0441\u0442\u043e\u0432\">\u0421\u043e\u044e\u0437 \u0441\u043e\u0446\u0438\u0430\u043b\u0438\u0441\u0442\u043e\u0432<\/a> \u0438 \u0440\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0430\u043d\u0446\u0435\u0432 \u0432\u043e \u0433\u043b\u0430\u0432\u0435 \u0441 \u041b\u0435\u043e\u043d\u043e\u043c \u0411\u043b\u044e\u043c\u043e\u043c \u0438 \u0432\u0441\u043a\u043e\u0440\u0435 \u0443\u0441\u0442\u0430\u043d\u0430\u0432\u043b\u0438\u0432\u0430\u044e\u0442 \u0442\u0435\u0441\u043d\u044b\u0435 \u043e\u0442\u043d\u043e\u0448\u0435\u043d\u0438\u044f \u0441 \u0441\u043e\u0446\u0438\u0430\u043b\u0438\u0441\u0442\u0430\u043c\u0438-\u0440\u0430\u0434\u0438\u043a\u0430\u043b\u0430\u043c\u0438 \u0438 \u043a\u043e\u043c\u043c\u0443\u043d\u0438\u0441\u0442\u0430\u043c\u0438 \u0432 \u0446\u0435\u043b\u044f\u0445 \u043e\u0431\u0440\u0430\u0437\u043e\u0432\u0430\u043d\u0438\u044f \u041d\u0430\u0440\u043e\u0434\u043d\u043e\u0433\u043e \u0444\u0440\u043e\u043d\u0442\u0430.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1936_%D0%B3%D0%BE%D0%B4\" title=\"1936 \u0433\u043e\u0434\">1936<\/a>&#160;\u2014 \u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D1%80%D0%B5%D0%B7%D0%B8%D0%B4%D0%B5%D0%BD%D1%82%D1%81%D0%BA%D0%B8%D0%B5_%D0%B2%D1%8B%D0%B1%D0%BE%D1%80%D1%8B_%D0%B2_%D0%A1%D0%A8%D0%90_(1936)\" title=\"\u041f\u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0442\u0441\u043a\u0438\u0435 \u0432\u044b\u0431\u043e\u0440\u044b \u0432 \u0421\u0428\u0410 (1936)\">\u043f\u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0442\u0441\u043a\u0438\u0445 \u0432\u044b\u0431\u043e\u0440\u0430\u0445 \u0432 \u0421\u0428\u0410<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D1%83%D0%B7%D0%B2%D0%B5%D0%BB%D1%8C%D1%82,_%D0%A4%D1%80%D0%B0%D0%BD%D0%BA%D0%BB%D0%B8%D0%BD\" title=\"\u0420\u0443\u0437\u0432\u0435\u043b\u044c\u0442, \u0424\u0440\u0430\u043d\u043a\u043b\u0438\u043d\">\u0424.&#160;\u0414.&#160;\u0420\u0443\u0437\u0432\u0435\u043b\u044c\u0442<\/a> \u0438\u0437\u0431\u0438\u0440\u0430\u0435\u0442\u0441\u044f \u043d\u0430 \u0432\u0442\u043e\u0440\u043e\u0439 \u0441\u0440\u043e\u043a.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1937_%D0%B3%D0%BE%D0%B4\" title=\"1937 \u0433\u043e\u0434\">1937<\/a>&#160;\u2014 \u0431\u0440\u044e\u0441\u0441\u0435\u043b\u044c\u0441\u043a\u0430\u044f \u043c\u0435\u0436\u0434\u0443\u043d\u0430\u0440\u043e\u0434\u043d\u0430\u044f \u043a\u043e\u043d\u0444\u0435\u0440\u0435\u043d\u0446\u0438\u044f (\u0434\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/24_%D0%BD%D0%BE%D1%8F%D0%B1%D1%80%D1%8F\" title=\"24 \u043d\u043e\u044f\u0431\u0440\u044f\">24 \u043d\u043e\u044f\u0431\u0440\u044f<\/a>) \u043e\u0431\u0441\u0443\u0436\u0434\u0430\u0435\u0442 \u0432\u043e\u043f\u0440\u043e\u0441\u044b, \u0441\u0432\u044f\u0437\u0430\u043d\u043d\u044b\u0435 \u0441 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AF%D0%BF%D0%BE%D0%BD%D0%BE-%D0%BA%D0%B8%D1%82%D0%B0%D0%B9%D1%81%D0%BA%D0%B0%D1%8F_%D0%B2%D0%BE%D0%B9%D0%BD%D0%B0_(1937%E2%80%941945)\" title=\"\u042f\u043f\u043e\u043d\u043e-\u043a\u0438\u0442\u0430\u0439\u0441\u043a\u0430\u044f \u0432\u043e\u0439\u043d\u0430 (1937\u20141945)\">\u044f\u043f\u043e\u043d\u043e-\u043a\u0438\u0442\u0430\u0439\u0441\u043a\u043e\u0439 \u0432\u043e\u0439\u043d\u043e\u0439<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1940_%D0%B3%D0%BE%D0%B4\" title=\"1940 \u0433\u043e\u0434\">1940<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D1%82%D0%BE%D1%80%D0%B0%D1%8F_%D0%BC%D0%B8%D1%80%D0%BE%D0%B2%D0%B0%D1%8F_%D0%B2%D0%BE%D0%B9%D0%BD%D0%B0\" title=\"\u0412\u0442\u043e\u0440\u0430\u044f \u043c\u0438\u0440\u043e\u0432\u0430\u044f \u0432\u043e\u0439\u043d\u0430\">\u0412\u0442\u043e\u0440\u0430\u044f \u043c\u0438\u0440\u043e\u0432\u0430\u044f \u0432\u043e\u0439\u043d\u0430<\/a>: \u0411\u0440\u0438\u0442\u0430\u043d\u0441\u043a\u0438\u0435 \u0432\u043e\u0439\u0441\u043a\u0430 \u043e\u043a\u043a\u0443\u043f\u0438\u0440\u0443\u044e\u0442 \u0421\u0443\u0434\u0430-\u0411\u0435\u0439 \u043d\u0430 \u043e\u0441\u0442\u0440\u043e\u0432\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D1%80%D0%B8%D1%82\" title=\"\u041a\u0440\u0438\u0442\">\u041a\u0440\u0438\u0442<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1941_%D0%B3%D0%BE%D0%B4\" title=\"1941 \u0433\u043e\u0434\">1941<\/a><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D0%BB%D0%B8%D0%BA%D0%B0%D1%8F_%D0%9E%D1%82%D0%B5%D1%87%D0%B5%D1%81%D1%82%D0%B2%D0%B5%D0%BD%D0%BD%D0%B0%D1%8F_%D0%B2%D0%BE%D0%B9%D0%BD%D0%B0\" title=\"\u0412\u0435\u043b\u0438\u043a\u0430\u044f \u041e\u0442\u0435\u0447\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u0430\u044f \u0432\u043e\u0439\u043d\u0430\">\u0412\u0435\u043b\u0438\u043a\u0430\u044f \u041e\u0442\u0435\u0447\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u0430\u044f \u0432\u043e\u0439\u043d\u0430<\/a>: \u0444\u0430\u0448\u0438\u0441\u0442\u044b \u0437\u0430\u043d\u0438\u043c\u0430\u044e\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D1%83%D1%80%D1%81%D0%BA\" title=\"\u041a\u0443\u0440\u0441\u043a\">\u041a\u0443\u0440\u0441\u043a<\/a>.<\/li><li>\u0423\u0441\u0442\u0440\u043e\u0435\u043d\u043d\u0430\u044f \u043d\u0435\u043c\u0435\u0446\u043a\u0438\u043c\u0438 \u043e\u043a\u043a\u0443\u043f\u0430\u0446\u0438\u043e\u043d\u043d\u044b\u043c\u0438 \u0432\u043b\u0430\u0441\u0442\u044f\u043c\u0438 \u0441\u0435\u0440\u0438\u044f \u0432\u0437\u0440\u044b\u0432\u043e\u0432 \u0432 \u043e\u043a\u043a\u0443\u043f\u0438\u0440\u043e\u0432\u0430\u043d\u043d\u043e\u043c \u043d\u0435\u043c\u0446\u0430\u043c\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B8%D0%B5%D0%B2\" title=\"\u041a\u0438\u0435\u0432\">\u041a\u0438\u0435\u0432\u0435<\/a>, \u0432 \u0440\u0435\u0437\u0443\u043b\u044c\u0442\u0430\u0442\u0435 \u043a\u043e\u0442\u043e\u0440\u043e\u0439 \u043d\u0430 \u0432\u043e\u0437\u0434\u0443\u0445 \u0432\u0437\u043b\u0435\u0442\u0435\u043b\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A3%D1%81%D0%BF%D0%B5%D0%BD%D1%81%D0%BA%D0%B8%D0%B9_%D1%81%D0%BE%D0%B1%D0%BE%D1%80_%D0%9A%D0%B8%D0%B5%D0%B2%D0%BE-%D0%9F%D0%B5%D1%87%D0%B5%D1%80%D1%81%D0%BA%D0%BE%D0%B9_%D0%BB%D0%B0%D0%B2%D1%80%D1%8B\" title=\"\u0423\u0441\u043f\u0435\u043d\u0441\u043a\u0438\u0439 \u0441\u043e\u0431\u043e\u0440 \u041a\u0438\u0435\u0432\u043e-\u041f\u0435\u0447\u0435\u0440\u0441\u043a\u043e\u0439 \u043b\u0430\u0432\u0440\u044b\">\u0423\u0441\u043f\u0435\u043d\u0441\u043a\u0438\u0439 \u0441\u043e\u0431\u043e\u0440<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B8%D0%B5%D0%B2%D0%BE-%D0%9F%D0%B5%D1%87%D0%B5%D1%80%D1%81%D0%BA%D0%B0%D1%8F_%D0%BB%D0%B0%D0%B2%D1%80%D0%B0\" title=\"\u041a\u0438\u0435\u0432\u043e-\u041f\u0435\u0447\u0435\u0440\u0441\u043a\u0430\u044f \u043b\u0430\u0432\u0440\u0430\">\u041a\u0438\u0435\u0432\u043e-\u041f\u0435\u0447\u0435\u0440\u0441\u043a\u043e\u0439 \u043b\u0430\u0432\u0440\u044b<\/a> \u0438 \u0435\u0449\u0451 \u043d\u0435\u0441\u043a\u043e\u043b\u044c\u043a\u043e \u0437\u0434\u0430\u043d\u0438\u0439 .<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1943_%D0%B3%D0%BE%D0%B4\" title=\"1943 \u0433\u043e\u0434\">1943<\/a>&#160;\u2014 \u0432 \u0445\u043e\u0434\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B8%D1%82%D0%B2%D0%B0_%D0%B7%D0%B0_%D0%94%D0%BD%D0%B5%D0%BF%D1%80\" title=\"\u0411\u0438\u0442\u0432\u0430 \u0437\u0430 \u0414\u043d\u0435\u043f\u0440\">\u0411\u0438\u0442\u0432\u044b \u0437\u0430 \u0414\u043d\u0435\u043f\u0440<\/a>, \u043d\u0430\u0447\u0438\u043d\u0430\u0435\u0442\u0441\u044f \u043a\u0438\u0435\u0432\u0441\u043a\u0430\u044f \u043d\u0430\u0441\u0442\u0443\u043f\u0430\u0442\u0435\u043b\u044c\u043d\u0430\u044f \u043e\u043f\u0435\u0440\u0430\u0446\u0438\u044f \u0432\u043e\u0439\u0441\u043a 1-\u0433\u043e \u0423\u043a\u0440\u0430\u0438\u043d\u0441\u043a\u043e\u0433\u043e \u0444\u0440\u043e\u043d\u0442\u0430.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1944_%D0%B3%D0%BE%D0%B4\" title=\"1944 \u0433\u043e\u0434\">1944<\/a><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BD%D1%82%D0%B8%D0%B3%D0%B8%D1%82%D0%BB%D0%B5%D1%80%D0%BE%D0%B2%D1%81%D0%BA%D0%B0%D1%8F_%D0%BA%D0%BE%D0%B0%D0%BB%D0%B8%D1%86%D0%B8%D1%8F\" title=\"\u0410\u043d\u0442\u0438\u0433\u0438\u0442\u043b\u0435\u0440\u043e\u0432\u0441\u043a\u0430\u044f \u043a\u043e\u0430\u043b\u0438\u0446\u0438\u044f\">\u0421\u043e\u044e\u0437\u043d\u044b\u0435 \u0434\u0435\u0440\u0436\u0430\u0432\u044b<\/a> \u043e\u0442\u043a\u0440\u044b\u0432\u0430\u044e\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B5%D0%BB%D1%8C%D0%B3%D0%B8%D1%8F\" title=\"\u0411\u0435\u043b\u044c\u0433\u0438\u044f\">\u0431\u0435\u043b\u044c\u0433\u0438\u0439\u0441\u043a\u0438\u0439<\/a> \u043f\u043e\u0440\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BD%D1%82%D0%B2%D0%B5%D1%80%D0%BF%D0%B5%D0%BD\" title=\"\u0410\u043d\u0442\u0432\u0435\u0440\u043f\u0435\u043d\">\u0410\u043d\u0442\u0432\u0435\u0440\u043f\u0435\u043d<\/a> \u0434\u043b\u044f \u0441\u0443\u0434\u043e\u0445\u043e\u0434\u0441\u0442\u0432\u0430.<\/li><li>\u041f\u0435\u0440\u0432\u043e\u0435 \u0431\u043e\u0435\u0432\u043e\u0435 \u043f\u0440\u0438\u043c\u0435\u043d\u0435\u043d\u0438\u0435 \u043c\u0435\u0436\u043a\u043e\u043d\u0442\u0438\u043d\u0435\u043d\u0442\u0430\u043b\u044c\u043d\u044b\u0445 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D1%8D%D1%80%D0%BE%D1%81%D1%82%D0%B0%D1%82\" title=\"\u0410\u044d\u0440\u043e\u0441\u0442\u0430\u0442\">\u0430\u044d\u0440\u043e\u0441\u0442\u0430\u0442\u043e\u0432<\/a> \u0441 \u0431\u043e\u043c\u0431\u043e\u0432\u043e\u0439 \u043d\u0430\u0433\u0440\u0443\u0437\u043a\u043e\u0439 \u043f\u0440\u0438 \u0430\u0442\u0430\u043a\u0435 \u044f\u043f\u043e\u043d\u0446\u0430\u043c\u0438 \u0421\u0428\u0410.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1950_%D0%B3%D0%BE%D0%B4\" title=\"1950 \u0433\u043e\u0434\">1950<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D0%BD%D0%B1%D0%BB%D0%B0%D0%BD\" title=\"\u041c\u043e\u043d\u0431\u043b\u0430\u043d\">\u041c\u043e\u043d\u0431\u043b\u0430\u043d<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D1%80%D0%B0%D0%BD%D1%86%D0%B8%D1%8F\" title=\"\u0424\u0440\u0430\u043d\u0446\u0438\u044f\">\u0424\u0440\u0430\u043d\u0446\u0438\u044f<\/a>. \u0421\u0430\u043c\u043e\u043b\u0451\u0442 Lockheed 749 Constellation \u043a\u043e\u043c\u043f\u0430\u043d\u0438\u0438 Air India, \u0432\u044b\u043f\u043e\u043b\u043d\u044f\u044e\u0449\u0438\u0439 \u0440\u0435\u0439\u0441 \u0438\u0437 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D0%B8%D1%80\" title=\"\u041a\u0430\u0438\u0440\">\u041a\u0430\u0438\u0440\u0430<\/a> \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%96%D0%B5%D0%BD%D0%B5%D0%B2%D0%B0\" title=\"\u0416\u0435\u043d\u0435\u0432\u0430\">\u0416\u0435\u043d\u0435\u0432\u0443<\/a>, \u0440\u0430\u0437\u0431\u0438\u0432\u0430\u0435\u0442\u0441\u044f \u0432 \u0443\u0441\u043b\u043e\u0432\u0438\u044f\u0445 \u0441\u043d\u0435\u0436\u043d\u043e\u0439 \u0431\u0443\u0440\u0438, \u0432\u0440\u0435\u0437\u0430\u0432\u0448\u0438\u0441\u044c \u0432 \u0433\u043e\u0440\u0443 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D0%BD%D0%B1%D0%BB%D0%B0%D0%BD\" title=\"\u041c\u043e\u043d\u0431\u043b\u0430\u043d\">\u041c\u043e\u043d\u0431\u043b\u0430\u043d<\/a> \u0432 200 \u043c\u0435\u0442\u0440\u0430\u0445 \u043d\u0438\u0436\u0435 \u0432\u0435\u0440\u0448\u0438\u043d\u044b. \u0412\u0441\u0435 48 \u0447\u0435\u043b\u043e\u0432\u0435\u043a \u043d\u0430 \u0431\u043e\u0440\u0442\u0443 \u043f\u043e\u0433\u0438\u0431\u0430\u044e\u0442.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1953_%D0%B3%D0%BE%D0%B4\" title=\"1953 \u0433\u043e\u0434\">1953<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%BE%D1%82%D0%BE%D1%81%D0%B8\" title=\"\u041f\u043e\u0442\u043e\u0441\u0438\">\u041f\u043e\u0442\u043e\u0441\u0438<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%BE%D0%BB%D0%B8%D0%B2%D0%B8%D1%8F\" title=\"\u0411\u043e\u043b\u0438\u0432\u0438\u044f\">\u0411\u043e\u043b\u0438\u0432\u0438\u044f<\/a>. \u0421\u0430\u043c\u043e\u043b\u0451\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/Douglas_DC-3\" title=\"Douglas DC-3\">Douglas DC-3<\/a> \u043a\u043e\u043c\u043f\u0430\u043d\u0438\u0438 Lloyd Aereo Boliviano \u0432\u0440\u0435\u0437\u0430\u0435\u0442\u0441\u044f \u0432 \u0433\u043e\u0440\u0443 \u043f\u0440\u0438 \u043f\u043e\u0441\u0430\u0434\u043a\u0435. \u0412\u0441\u0435 28 \u0447\u0435\u043b\u043e\u0432\u0435\u043a \u043d\u0430 \u0431\u043e\u0440\u0442\u0443 \u043f\u043e\u0433\u0438\u0431\u0430\u044e\u0442.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1954_%D0%B3%D0%BE%D0%B4\" title=\"1954 \u0433\u043e\u0434\">1954<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AF%D0%BF%D0%BE%D0%BD%D0%B8%D1%8F\" title=\"\u042f\u043f\u043e\u043d\u0438\u044f\">\u042f\u043f\u043e\u043d\u0438\u0438<\/a> \u043d\u0430 \u044d\u043a\u0440\u0430\u043d \u0432\u043f\u0435\u0440\u0432\u044b\u0435 \u0432\u044b\u043f\u0443\u0441\u043a\u0430\u0435\u0442\u0441\u044f \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%BE%D0%B4%D0%B7%D0%B8%D0%BB%D0%BB%D0%B0_(%D1%84%D0%B8%D0%BB%D1%8C%D0%BC,_1954)\" title=\"\u0413\u043e\u0434\u0437\u0438\u043b\u043b\u0430 (\u0444\u0438\u043b\u044c\u043c, 1954)\">\u0413\u043e\u0434\u0437\u0438\u043b\u043b\u0430<\/a>\u00bb.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1955_%D0%B3%D0%BE%D0%B4\" title=\"1955 \u0433\u043e\u0434\">1955<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D1%80%D0%B0%D0%BD\" title=\"\u0418\u0440\u0430\u043d\">\u0418\u0440\u0430\u043d<\/a> \u043f\u0440\u0438\u0441\u043e\u0435\u0434\u0438\u043d\u044f\u0435\u0442\u0441\u044f \u043a <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B0%D0%B3%D0%B4%D0%B0%D0%B4%D1%81%D0%BA%D0%B8%D0%B9_%D0%BF%D0%B0%D0%BA%D1%82\" class=\"mw-redirect\" title=\"\u0411\u0430\u0433\u0434\u0430\u0434\u0441\u043a\u0438\u0439 \u043f\u0430\u043a\u0442\">\u0411\u0430\u0433\u0434\u0430\u0434\u0441\u043a\u043e\u043c\u0443 \u043f\u0430\u043a\u0442\u0443<\/a> (\u043f\u043e\u0434\u043f\u0438\u0441\u0430\u043d <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D1%80%D0%B0%D0%BA\" title=\"\u0418\u0440\u0430\u043a\">\u0418\u0440\u0430\u043a\u043e\u043c<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D1%83%D1%80%D1%86%D0%B8%D1%8F\" title=\"\u0422\u0443\u0440\u0446\u0438\u044f\">\u0422\u0443\u0440\u0446\u0438\u0435\u0439<\/a>).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1956_%D0%B3%D0%BE%D0%B4\" title=\"1956 \u0433\u043e\u0434\">1956<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D0%BB%D0%B8%D0%BA%D0%BE%D0%B1%D1%80%D0%B8%D1%82%D0%B0%D0%BD%D0%B8%D1%8F\" title=\"\u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u044f\">\u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u044f<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D1%80%D0%B0%D0%BD%D1%86%D0%B8%D1%8F\" title=\"\u0424\u0440\u0430\u043d\u0446\u0438\u044f\">\u0424\u0440\u0430\u043d\u0446\u0438\u044f<\/a> \u0441\u043e\u043e\u0431\u0449\u0430\u044e\u0442 \u043e \u0441\u0432\u043e\u0435\u0439 \u0433\u043e\u0442\u043e\u0432\u043d\u043e\u0441\u0442\u0438 \u043f\u0440\u0435\u043a\u0440\u0430\u0442\u0438\u0442\u044c \u0432\u043e\u0435\u043d\u043d\u044b\u0435 \u0434\u0435\u0439\u0441\u0442\u0432\u0438\u044f \u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%BB%D0%B8%D0%B6%D0%BD%D0%B8%D0%B9_%D0%92%D0%BE%D1%81%D1%82%D0%BE%D0%BA\" title=\"\u0411\u043b\u0438\u0436\u043d\u0438\u0439 \u0412\u043e\u0441\u0442\u043e\u043a\">\u0411\u043b\u0438\u0436\u043d\u0435\u043c \u0412\u043e\u0441\u0442\u043e\u043a\u0435<\/a>, \u0435\u0441\u043b\u0438 \u0432\u043e\u0439\u0441\u043a\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D1%80%D0%B3%D0%B0%D0%BD%D0%B8%D0%B7%D0%B0%D1%86%D0%B8%D1%8F_%D0%9E%D0%B1%D1%8A%D0%B5%D0%B4%D0%B8%D0%BD%D1%91%D0%BD%D0%BD%D1%8B%D1%85_%D0%9D%D0%B0%D1%86%D0%B8%D0%B9\" title=\"\u041e\u0440\u0433\u0430\u043d\u0438\u0437\u0430\u0446\u0438\u044f \u041e\u0431\u044a\u0435\u0434\u0438\u043d\u0451\u043d\u043d\u044b\u0445 \u041d\u0430\u0446\u0438\u0439\">\u041e\u041e\u041d<\/a> \u043e\u0431\u0435\u0441\u043f\u0435\u0447\u0430\u0442 \u043c\u0438\u0440 \u0432 \u044d\u0442\u043e\u043c \u0440\u0435\u0433\u0438\u043e\u043d\u0435.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1957_%D0%B3%D0%BE%D0%B4\" title=\"1957 \u0433\u043e\u0434\">1957<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%A1%D0%A1%D0%A0\" class=\"mw-redirect\" title=\"\u0421\u0421\u0421\u0420\">\u0421\u0421\u0421\u0420<\/a> \u0437\u0430\u043f\u0443\u0449\u0435\u043d <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D1%81%D0%BC%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B8%D0%B9_%D0%B0%D0%BF%D0%BF%D0%B0%D1%80%D0%B0%D1%82\" title=\"\u041a\u043e\u0441\u043c\u0438\u0447\u0435\u0441\u043a\u0438\u0439 \u0430\u043f\u043f\u0430\u0440\u0430\u0442\">\u041a\u0410<\/a> \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BF%D1%83%D1%82%D0%BD%D0%B8%D0%BA-2\" title=\"\u0421\u043f\u0443\u0442\u043d\u0438\u043a-2\">\u0421\u043f\u0443\u0442\u043d\u0438\u043a-2<\/a>\u00bb \u0441 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B0%D0%B9%D0%BA%D0%B0_(%D1%81%D0%BE%D0%B1%D0%B0%D0%BA%D0%B0-%D0%BA%D0%BE%D1%81%D0%BC%D0%BE%D0%BD%D0%B0%D0%B2%D1%82)\" title=\"\u041b\u0430\u0439\u043a\u0430 (\u0441\u043e\u0431\u0430\u043a\u0430-\u043a\u043e\u0441\u043c\u043e\u043d\u0430\u0432\u0442)\">\u0441\u043e\u0431\u0430\u043a\u043e\u0439 \u041b\u0430\u0439\u043a\u043e\u0439<\/a> \u043d\u0430 \u0431\u043e\u0440\u0442\u0443. \u0421\u043e\u0431\u0430\u043a\u0430 \u043f\u043e\u0433\u0438\u0431\u043b\u0430 \u0447\u0435\u0440\u0435\u0437 7 \u0447\u0430\u0441\u043e\u0432 \u043f\u043e\u0441\u043b\u0435 \u0441\u0442\u0430\u0440\u0442\u0430 \u043e\u0442 \u043f\u0435\u0440\u0435\u0433\u0440\u0435\u0432\u0430.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1958_%D0%B3%D0%BE%D0%B4\" title=\"1958 \u0433\u043e\u0434\">1958<\/a>&#160;\u2014 \u0441\u043e\u0432\u0435\u0442\u0441\u043a\u0438\u0439 \u0430\u0441\u0442\u0440\u043e\u043d\u043e\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D0%B7%D1%8B%D1%80%D0%B5%D0%B2,_%D0%9D%D0%B8%D0%BA%D0%BE%D0%BB%D0%B0%D0%B9_%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u041a\u043e\u0437\u044b\u0440\u0435\u0432, \u041d\u0438\u043a\u043e\u043b\u0430\u0439 \u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u043e\u0432\u0438\u0447\">\u041d.&#160;\u0410.&#160;\u041a\u043e\u0437\u044b\u0440\u0435\u0432<\/a> \u043d\u0430\u0431\u043b\u044e\u0434\u0430\u043b \u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D1%83%D0%BD%D0%B0\" title=\"\u041b\u0443\u043d\u0430\">\u041b\u0443\u043d\u0435<\/a>, \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BB%D1%8C%D1%84%D0%BE%D0%BD%D1%81_(%D0%BB%D1%83%D0%BD%D0%BD%D1%8B%D0%B9_%D0%BA%D1%80%D0%B0%D1%82%D0%B5%D1%80)\" title=\"\u0410\u043b\u044c\u0444\u043e\u043d\u0441 (\u043b\u0443\u043d\u043d\u044b\u0439 \u043a\u0440\u0430\u0442\u0435\u0440)\">\u043a\u0440\u0430\u0442\u0435\u0440\u0435 \u0410\u043b\u044c\u0444\u043e\u043d\u0441<\/a>, \u0432\u044b\u0434\u0435\u043b\u0435\u043d\u0438\u0435 \u0433\u0430\u0437\u043e\u0432, \u0441\u0445\u043e\u0434\u043d\u044b\u0445 \u043f\u043e \u0441\u043f\u0435\u043a\u0442\u0440\u0430\u043b\u044c\u043d\u043e\u043c\u0443 \u0441\u043e\u0441\u0442\u0430\u0432\u0443 \u0441 \u0433\u0430\u0437\u0430\u043c\u0438 \u0437\u0435\u043c\u043d\u044b\u0445 \u0432\u0443\u043b\u043a\u0430\u043d\u043e\u0432, \u0438\u0437 \u0447\u0435\u0433\u043e \u0441\u0434\u0435\u043b\u0430\u043b \u0432\u044b\u0432\u043e\u0434 \u043e \u0432\u0443\u043b\u043a\u0430\u043d\u0438\u0447\u0435\u0441\u043a\u043e\u0439 \u0430\u043a\u0442\u0438\u0432\u043d\u043e\u0441\u0442\u0438.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1961_%D0%B3%D0%BE%D0%B4\" title=\"1961 \u0433\u043e\u0434\">1961<\/a>&#160;\u2014 \u043f\u043e\u0441\u043b\u0435 \u0433\u0438\u0431\u0435\u043b\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B5%D0%BD%D0%B5%D1%80%D0%B0%D0%BB%D1%8C%D0%BD%D1%8B%D0%B9_%D1%81%D0%B5%D0%BA%D1%80%D0%B5%D1%82%D0%B0%D1%80%D1%8C_%D0%9E%D0%9E%D0%9D\" title=\"\u0413\u0435\u043d\u0435\u0440\u0430\u043b\u044c\u043d\u044b\u0439 \u0441\u0435\u043a\u0440\u0435\u0442\u0430\u0440\u044c \u041e\u041e\u041d\">\u0413\u0435\u043d\u0435\u0440\u0430\u043b\u044c\u043d\u043e\u0433\u043e \u0441\u0435\u043a\u0440\u0435\u0442\u0430\u0440\u044f \u041e\u041e\u041d<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A5%D0%B0%D0%BC%D0%BC%D0%B0%D1%80%D1%88%D1%91%D0%BB%D1%8C%D0%B4,_%D0%94%D0%B0%D0%B3\" title=\"\u0425\u0430\u043c\u043c\u0430\u0440\u0448\u0451\u043b\u044c\u0434, \u0414\u0430\u0433\">\u0414\u0430\u0433\u0430 \u0425\u0430\u043c\u043c\u0430\u0440\u0448\u0451\u043b\u044c\u0434\u0430<\/a> \u0432 \u043a\u0430\u0447\u0435\u0441\u0442\u0432\u0435 \u043a\u043e\u043c\u043f\u0440\u043e\u043c\u0438\u0441\u0441\u043d\u043e\u0439 \u0444\u0438\u0433\u0443\u0440\u044b \u0438\u0441\u043f\u043e\u043b\u043d\u044f\u044e\u0449\u0438\u043c \u043e\u0431\u044f\u0437\u0430\u043d\u043d\u043e\u0441\u0442\u0438 \u0433\u0435\u043d\u0441\u0435\u043a\u0430 \u0438\u0437\u0431\u0438\u0440\u0430\u0435\u0442\u0441\u044f \u043f\u0440\u0435\u0434\u0441\u0442\u0430\u0432\u0438\u0442\u0435\u043b\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D1%8C%D1%8F%D0%BD%D0%BC%D0%B0\" title=\"\u041c\u044c\u044f\u043d\u043c\u0430\">\u0411\u0438\u0440\u043c\u044b<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A3_%D0%A2%D0%B0%D0%BD\" title=\"\u0423 \u0422\u0430\u043d\">\u0423 \u0422\u0430\u043d<\/a>. \u0412\u043f\u043e\u0441\u043b\u0435\u0434\u0441\u0442\u0432\u0438\u0438 \u043e\u043d \u0431\u0443\u0434\u0435\u0442 \u0437\u0430\u043d\u0438\u043c\u0430\u0442\u044c \u044d\u0442\u043e\u0442 \u043f\u043e\u0441\u0442 \u0434\u0432\u0430 \u043e\u0444\u0438\u0446\u0438\u0430\u043b\u044c\u043d\u044b\u0445 \u0441\u0440\u043e\u043a\u0430.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1963_%D0%B3%D0%BE%D0%B4\" title=\"1963 \u0433\u043e\u0434\">1963<\/a>&#160;\u2014 \u0441\u0432\u0430\u0434\u044c\u0431\u0430 \u043a\u043e\u0441\u043c\u043e\u043d\u0430\u0432\u0442\u043e\u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B8%D0%BA%D0%BE%D0%BB%D0%B0%D0%B5%D0%B2,_%D0%90%D0%BD%D0%B4%D1%80%D0%B8%D1%8F%D0%BD_%D0%93%D1%80%D0%B8%D0%B3%D0%BE%D1%80%D1%8C%D0%B5%D0%B2%D0%B8%D1%87\" title=\"\u041d\u0438\u043a\u043e\u043b\u0430\u0435\u0432, \u0410\u043d\u0434\u0440\u0438\u044f\u043d \u0413\u0440\u0438\u0433\u043e\u0440\u044c\u0435\u0432\u0438\u0447\">\u0410\u043d\u0434\u0440\u0438\u044f\u043d\u0430 \u041d\u0438\u043a\u043e\u043b\u0430\u0435\u0432\u0430<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D0%B5%D1%80%D0%B5%D1%88%D0%BA%D0%BE%D0%B2%D0%B0,_%D0%92%D0%B0%D0%BB%D0%B5%D0%BD%D1%82%D0%B8%D0%BD%D0%B0_%D0%92%D0%BB%D0%B0%D0%B4%D0%B8%D0%BC%D0%B8%D1%80%D0%BE%D0%B2%D0%BD%D0%B0\" title=\"\u0422\u0435\u0440\u0435\u0448\u043a\u043e\u0432\u0430, \u0412\u0430\u043b\u0435\u043d\u0442\u0438\u043d\u0430 \u0412\u043b\u0430\u0434\u0438\u043c\u0438\u0440\u043e\u0432\u043d\u0430\">\u0412\u0430\u043b\u0435\u043d\u0442\u0438\u043d\u044b \u0422\u0435\u0440\u0435\u0448\u043a\u043e\u0432\u043e\u0439<\/a>. \u0412\u043f\u043e\u0441\u043b\u0435\u0434\u0441\u0442\u0432\u0438\u0438 \u043e\u043d\u0438 \u0440\u0430\u0437\u0432\u0435\u0434\u0443\u0442\u0441\u044f.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1964_%D0%B3%D0%BE%D0%B4\" title=\"1964 \u0433\u043e\u0434\">1964<\/a>&#160;\u2014 \u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D1%80%D0%B5%D0%B7%D0%B8%D0%B4%D0%B5%D0%BD%D1%82%D1%81%D0%BA%D0%B8%D0%B5_%D0%B2%D1%8B%D0%B1%D0%BE%D1%80%D1%8B_%D0%B2_%D0%A1%D0%A8%D0%90_(1964)\" title=\"\u041f\u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0442\u0441\u043a\u0438\u0435 \u0432\u044b\u0431\u043e\u0440\u044b \u0432 \u0421\u0428\u0410 (1964)\">\u043f\u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0442\u0441\u043a\u0438\u0445 \u0432\u044b\u0431\u043e\u0440\u0430\u0445 \u0432 \u0421\u0428\u0410<\/a> \u043f\u043e\u0431\u0435\u0434\u0443 \u043e\u0434\u0435\u0440\u0436\u0438\u0432\u0430\u0435\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B5%D0%BC%D0%BE%D0%BA%D1%80%D0%B0%D1%82%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B0%D1%8F_%D0%BF%D0%B0%D1%80%D1%82%D0%B8%D1%8F_(%D0%A1%D0%A8%D0%90)\" title=\"\u0414\u0435\u043c\u043e\u043a\u0440\u0430\u0442\u0438\u0447\u0435\u0441\u043a\u0430\u044f \u043f\u0430\u0440\u0442\u0438\u044f (\u0421\u0428\u0410)\">\u0434\u0435\u043c\u043e\u043a\u0440\u0430\u0442<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B6%D0%BE%D0%BD%D1%81%D0%BE%D0%BD,_%D0%9B%D0%B8%D0%BD%D0%B4%D0%BE%D0%BD\" title=\"\u0414\u0436\u043e\u043d\u