u044f&#160;\u2014 \u043b\u0438\u043d\u0438\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B5%D1%82%D0%B5%D1%80%D0%B1%D1%83%D1%80%D0%B3%D1%81%D0%BA%D0%B8%D0%B9_%D0%BC%D0%B5%D1%82%D1%80%D0%BE%D0%BF%D0%BE%D0%BB%D0%B8%D1%82%D0%B5%D0%BD\" title=\"\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\u0441\u043a\u0438\u0439 \u043c\u0435\u0442\u0440\u043e\u043f\u043e\u043b\u0438\u0442\u0435\u043d\">\u041b\u0435\u043d\u0438\u043d\u0433\u0440\u0430\u0434\u0441\u043a\u043e\u0433\u043e \u043c\u0435\u0442\u0440\u043e<\/a>.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1969_%D0%B3%D0%BE%D0%B4\" title=\"1969 \u0433\u043e\u0434\">1969<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D1%80%D0%B5%D0%B7%D0%B8%D0%B4%D0%B5%D0%BD%D1%82_%D0%A1%D0%A8%D0%90\" title=\"\u041f\u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0442 \u0421\u0428\u0410\">\u043f\u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0442 \u0421\u0428\u0410<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B8%D0%BA%D1%81%D0%BE%D0%BD,_%D0%A0%D0%B8%D1%87%D0%B0%D1%80%D0%B4_%D0%9C%D0%B8%D0%BB%D1%85%D0%B0%D1%83%D0%B7\" class=\"mw-redirect\" title=\"\u041d\u0438\u043a\u0441\u043e\u043d, \u0420\u0438\u0447\u0430\u0440\u0434 \u041c\u0438\u043b\u0445\u0430\u0443\u0437\">\u041d\u0438\u043a\u0441\u043e\u043d<\/a> \u043f\u043e\u043e\u0431\u0435\u0449\u0430\u043b \u0432\u044b\u0432\u0435\u0441\u0442\u0438 \u0441 \u0442\u0435\u0440\u0440\u0438\u0442\u043e\u0440\u0438\u0438 \u042e\u0436\u043d\u043e\u0433\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D1%8C%D0%B5%D1%82%D0%BD%D0%B0%D0%BC\" title=\"\u0412\u044c\u0435\u0442\u043d\u0430\u043c\">\u0412\u044c\u0435\u0442\u043d\u0430\u043c\u0430<\/a> \u0432\u0441\u0435 \u0430\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u0438\u0435 \u0441\u0443\u0445\u043e\u043f\u0443\u0442\u043d\u044b\u0435 \u0447\u0430\u0441\u0442\u0438 .<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1970_%D0%B3%D0%BE%D0%B4\" title=\"1970 \u0433\u043e